import React, { useState, useEffect } from 'react';
import {
  Container,
  Box,
  TextField,
  Button,
  Typography,
  Paper,
  Grid,
  CircularProgress,
  Alert,
  ThemeProvider,
  createTheme,
  CssBaseline,
} from '@mui/material';
import { io } from 'socket.io-client';
import ThreatIntelligence from './components/ThreatIntelligence';
import {
  AreaChart,
  Area,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  ResponsiveContainer,
} from 'recharts';

// Create dark theme
const darkTheme = createTheme({
  palette: {
    mode: 'dark',
    primary: {
      main: '#90caf9',
    },
    secondary: {
      main: '#f48fb1',
    },
    background: {
      default: '#121212',
      paper: '#1e1e1e',
    },
  },
});

const socket = io('http://localhost:5001');

function App() {
  const [url, setUrl] = useState('');
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [result, setResult] = useState(null);
  const [realtimeData, setRealtimeData] = useState(null);
  const [scanHistory, setScanHistory] = useState([]);

  useEffect(() => {
    socket.on('realtime_monitoring', (data) => {
      setRealtimeData(data);
    });

    // Fetch scan history
    fetch('http://localhost:5001/api/history')
      .then(res => res.json())
      .then(data => setScanHistory(data))
      .catch(err => console.error('Error fetching history:', err));

    return () => {
      socket.off('realtime_monitoring');
    };
  }, []);

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');
    setResult(null);

    try {
      const response = await fetch('http://localhost:5001/api/analyze', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ url }),
      });

      const data = await response.json();
      if (response.ok) {
        setResult(data);
        // Refresh scan history
        const historyResponse = await fetch('http://localhost:5001/api/history');
        const historyData = await historyResponse.json();
        setScanHistory(historyData);
      } else {
        setError(data.error || 'An error occurred');
      }
    } catch (err) {
      setError('Failed to connect to the server');
    } finally {
      setLoading(false);
    }
  };

  return (
    <ThemeProvider theme={darkTheme}>
      <CssBaseline />
      <Container maxWidth="lg">
        <Box sx={{ my: 4 }}>
          <Typography variant="h3" component="h1" gutterBottom align="center">
            Cyber Threat Detection
          </Typography>

          <Paper sx={{ p: 3, mb: 4 }}>
            <form onSubmit={handleSubmit}>
              <Grid container spacing={2} alignItems="center">
                <Grid item xs={12} md={9}>
                  <TextField
                    fullWidth
                    label="Enter URL to analyze"
                    value={url}
                    onChange={(e) => setUrl(e.target.value)}
                    variant="outlined"
                    error={!!error}
                    helperText={error}
                  />
                </Grid>
                <Grid item xs={12} md={3}>
                  <Button
                    fullWidth
                    variant="contained"
                    type="submit"
                    disabled={loading}
                    sx={{ height: '56px' }}
                  >
                    {loading ? <CircularProgress size={24} /> : 'Analyze'}
                  </Button>
                </Grid>
              </Grid>
            </form>
          </Paper>

          {result && (
            <Grid container spacing={3}>
              <Grid item xs={12}>
                <ThreatIntelligence data={result} />
              </Grid>

              <Grid item xs={12} md={6}>
                <Paper sx={{ p: 3, height: '100%' }}>
                  <Typography variant="h6" gutterBottom>
                    Traffic Analysis
                  </Typography>
                  <Box sx={{ height: 300 }}>
                    <ResponsiveContainer width="100%" height="100%">
                      <AreaChart data={result.chart_data}>
                        <CartesianGrid strokeDasharray="3 3" />
                        <XAxis dataKey="name" />
                        <YAxis />
                        <Tooltip />
                        <Area
                          type="monotone"
                          dataKey="vendors"
                          stackId="1"
                          stroke="#8884d8"
                          fill="#8884d8"
                        />
                      </AreaChart>
                    </ResponsiveContainer>
                  </Box>
                </Paper>
              </Grid>

              <Grid item xs={12} md={6}>
                <Paper sx={{ p: 3, height: '100%' }}>
                  <Typography variant="h6" gutterBottom>
                    Real-time Monitoring
                  </Typography>
                  {realtimeData && (
                    <Grid container spacing={2}>
                      <Grid item xs={6}>
                        <Typography variant="body2" color="textSecondary">
                          Current Visitors
                        </Typography>
                        <Typography variant="h4">
                          {realtimeData.current_visitors}
                        </Typography>
                      </Grid>
                      <Grid item xs={6}>
                        <Typography variant="body2" color="textSecondary">
                          Peak Visitors
                        </Typography>
                        <Typography variant="h4">
                          {realtimeData.peak_visitors}
                        </Typography>
                      </Grid>
                      <Grid item xs={6}>
                        <Typography variant="body2" color="textSecondary">
                          Total Visits
                        </Typography>
                        <Typography variant="h4">
                          {realtimeData.total_visits}
                        </Typography>
                      </Grid>
                      <Grid item xs={6}>
                        <Typography variant="body2" color="textSecondary">
                          Trend
                        </Typography>
                        <Typography
                          variant="h4"
                          color={realtimeData.trend.startsWith('+') ? 'success.main' : 'error.main'}
                        >
                          {realtimeData.trend}
                        </Typography>
                      </Grid>
                    </Grid>
                  )}
                </Paper>
              </Grid>

              <Grid item xs={12}>
                <Paper sx={{ p: 3 }}>
                  <Typography variant="h6" gutterBottom>
                    Recent Scans
                  </Typography>
                  <Grid container spacing={2}>
                    {scanHistory.map((scan) => (
                      <Grid item xs={12} sm={6} md={4} key={scan._id}>
                        <Paper
                          variant="outlined"
                          sx={{ p: 2, cursor: 'pointer' }}
                          onClick={() => setResult(scan.result)}
                        >
                          <Typography variant="subtitle1" noWrap>
                            {scan.url}
                          </Typography>
                          <Typography variant="body2" color="textSecondary">
                            {new Date(scan.timestamp).toLocaleString()}
                          </Typography>
                          <Typography
                            variant="body2"
                            color={
                              scan.result.threat_level === 'HIGH'
                                ? 'error.main'
                                : scan.result.threat_level === 'MEDIUM'
                                ? 'warning.main'
                                : 'success.main'
                            }
                          >
                            Threat Level: {scan.result.threat_level}
                          </Typography>
                        </Paper>
                      </Grid>
                    ))}
                  </Grid>
                </Paper>
              </Grid>
            </Grid>
          )}
        </Box>
      </Container>
    </ThemeProvider>
  );
}

export default App;
